import React, { useState, useEffect } from 'react';
import './Global.css';
import { FaReact } from 'react-icons/fa';
import hooksData from '../Data/reactHooks.json'; // import JSON

function ReactHooks() {
  const [completed, setCompleted] = useState(false);
  const [hooksTopic, setHooksTopic] = useState([]);

  useEffect(() => {
    // Load hooks data from JSON
    if (hooksData && hooksData.reactHooks) {
      setHooksTopic(hooksData.reactHooks);
    }
  }, []);

  const toggleComplete = () => {
    setCompleted(!completed);
  };

  if (!hooksTopic.length) return <div>Loading...</div>;

  return (
    <div className="container">
      {/* Sidebar */}
      <div className="sidebar open">
        <div className="sidebar-header">
          <h3 className='nav-title'>React Hooks</h3>
        </div>
        <ul>
          {hooksTopic.map((hook, index) => (
            <li key={index} className={`active ${completed ? 'completed' : ''}`}>
              <span className="topic-number">{index + 1}</span>
              <span className="topic-title">
                <FaReact size={24} color="#667eea" />
                {hook.name}
              </span>
              {completed && <span className="check-mark">✓</span>}
            </li>
          ))}
        </ul>
      </div>

      {/* Main content */}
      <div className="main-content">
        <div className="content-header">
          <h2 className="content-title">
            <FaReact size={40} color="#667eea" />
            <span className="topic-badge">1.</span>
            React Hooks
          </h2>
          <button 
            className={`complete-btn ${completed ? 'completed' : ''}`}
            onClick={toggleComplete}
          >
            {completed ? '✓ Completed' : 'Mark Complete'}
          </button>
        </div>

        <div className="content-section">
          <h3>All Major React Hooks Explained</h3>
          <ol className="questions-list">
            {hooksTopic.map((hook, index) => (
              <li key={index} className="question-item" style={{ marginBottom: '20px' }}>
                <strong>{index + 1}. {hook.name}</strong>
                <p><strong>Purpose:</strong> {hook.purpose}</p>
                <p><strong>Example:</strong></p>
                <pre style={{ background: '#f5f5f5', padding: '10px' }}>{hook.example}</pre>
                <p><strong>Tips:</strong></p>
                <ul>
                  {hook.tips.map((tip, i) => <li key={i}>{tip}</li>)}
                </ul>
                <p><strong>Common Mistakes:</strong></p>
                <ul>
                  {hook.commonMistakes.map((mistake, i) => <li key={i}>{mistake}</li>)}
                </ul>
              </li>
            ))}
          </ol>
        </div>
      </div>
    </div>
  );
}

export default ReactHooks;
